contracts/interfaces/IMemeMintErrors.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.28;

/**
 * @title IMemeMintErrors
 * @notice Interface containing all custom errors for the MemeMint contract
 * @dev Separating errors improves code organization and reusability
 * @author Dev Team
 */
interface IMemeMintErrors {
    /// @notice Error for insufficient payment
    error InsufficientPayment();

    /// @notice Error for invalid mint fee
    error InvalidMintFee();

    /// @notice Error when no funds available to withdraw
    error NoFundsToWithdraw();

    /// @notice Error when transfer fails
    error TransferFailed();

    /// @notice Error when refund fails
    error RefundFailed();

    /// @notice Error for invalid function calls
    error InvalidFunctionCall();

    /// @notice Error for zero address inputs
    error ZeroAddress();

    /// @notice Error for invalid implementation contract
    error InvalidImplementation();

    /// @notice Error for initialization failure
    error InitializationFailed();

    /// @notice Error for rate limit exceeded
    error RateLimitExceeded();

    /// @notice Error for invalid leaderboard address
    error InvalidLeaderboardAddress();

    /// @notice Error for invalid user address
    error InvalidUserAddress();

    /// @notice Error for invalid mint count
    error InvalidMintCount();

    /// @notice Error for invalid count range
    error InvalidCountRange();

    /// @notice Error for invalid position range
    error InvalidPositionRange();

    /// @notice Error for position not filled
    error PositionNotFilled();
}

contracts/interfaces/IMemeMintEvents.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.28;

/**
 * @title IMemeMintEvents
 * @notice Interface containing all events for the MemeMint contract
 * @dev Separating events improves code organization and makes the contract more readable
 * @author Dev Team
 */
interface IMemeMintEvents {
    /// @notice Event emitted when a meme is minted
    /// @param user The address that minted (indexed for filtering)
    /// @param feePaid Fee paid for the mint (in wei) (indexed for filtering)
    event MemeMinted(address indexed user, uint256 indexed feePaid);

    /// @notice Event emitted when mint fee is updated
    /// @param oldFee Previous mint fee (indexed for filtering)
    /// @param newFee New mint fee (indexed for filtering)
    event MintFeeUpdated(uint256 indexed oldFee, uint256 indexed newFee);

    /// @notice Event emitted when funds are withdrawn
    /// @param owner The owner who withdrew funds (indexed for filtering)
    /// @param amount Amount withdrawn (indexed for filtering)
    event FundsWithdrawn(address indexed owner, uint256 indexed amount);

    /// @notice Event emitted during emergency withdrawal
    /// @param owner The owner who performed emergency withdrawal (indexed for filtering)
    /// @param amount Amount withdrawn (indexed for filtering)
    event EmergencyWithdraw(address indexed owner, uint256 indexed amount);

    /// @notice Event emitted when contract is initialized
    /// @param owner The initial owner of the contract (indexed for filtering)
    /// @param mintFee The initial mint fee (indexed for filtering)
    event Initialized(address indexed owner, uint256 indexed mintFee);

    /// @notice Event emitted when contract is paused
    /// @param owner The owner who paused the contract
    event ContractPaused(address indexed owner);

    /// @notice Event emitted when contract is unpaused
    /// @param owner The owner who unpaused the contract
    event ContractUnpaused(address indexed owner);

    /// @notice Event emitted when rate limit is hit
    /// @param user The user who hit the rate limit (indexed for filtering)
    /// @param day The day when the rate limit was hit (indexed for filtering)
    event RateLimitHit(address indexed user, uint256 indexed day);
}

contracts/interfaces/IMemeMintLeaderboar.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.28;

/**
 * @title IMemeMintLeaderboard
 * @notice Interface for the MemeMint leaderboard contract
 * @dev Defines the functions that the leaderboard contract must implement
 * @author Dev Team
 */
interface IMemeMintLeaderboard {
    struct LeaderboardEntry {
        address user;
        uint256 totalMints;
        uint256 lastMintTime;
    }

    /**
     * @notice Updates a minter's position in the leaderboard
     * @param user The address of the user to update
     * @param newTotalMints The new total number of mints for this user
     */
    function updateMinter(address user, uint256 newTotalMints) external;

    /**
     * @notice Gets the top minters from the leaderboard
     * @param count The number of top minters to return
     * @return Array of leaderboard entries for the top minters
     */
    function getTopMinters(uint256 count) external view returns (LeaderboardEntry[] memory);

    /**
     * @notice Gets a user's leaderboard entry and position
     * @param user The address of the user to query
     * @return entry The user's leaderboard entry
     * @return position The user's position in the leaderboard (0 if not in top 100)
     */
    function getUserEntry(address user) external view returns (LeaderboardEntry memory entry, uint256 position);

    /**
     * @notice Gets statistics about the current leaderboard state
     * @return totalMinters The total number of minters in the leaderboard
     * @return minMints The minimum number of mints required to be in the leaderboard
     */
    function getLeaderboardStats() external view returns (uint256 totalMinters, uint256 minMints);

    /**
     * @notice Checks if a user is in the top 100 minters
     * @param user The address of the user to check
     * @return True if the user is in the top 100, false otherwise
     */
    function isInTop100(address user) external view returns (bool);

    /**
     * @notice Gets the leaderboard entry at a specific position
     * @param position The position to query (1-100)
     * @return entry The leaderboard entry at the specified position
     */
    function getEntryAtPosition(uint256 position) external view returns (LeaderboardEntry memory entry);
}

